// NavBar.js
import React from 'react';
import { Link } from 'react-router-dom';

function NavBar() {
  return (
    <nav>
      <ul>
        <li>
          <Link to="/">Home</Link>
        </li>
        <li>
          <Link to="/graficos">Gráficos</Link>
        </li>
        <li>
          <Link to="/votacao">Votação</Link>
        </li>
      </ul>
    </nav>
  );
}

export default NavBar;
